import React from 'react'

import { TableRow, TableCell } from '@mui/material';

const StaffTableColNames = () => {
  const tableCellSX = {
    color: 'white',
    fontSize: '10px'
  }
  return (
    <TableRow sx={{
      bgcolor: '#03074f'

    }}>
      <TableCell sx={tableCellSX}>S/R</TableCell>
      <TableCell>ΟΝΟΜΑ</TableCell>
      <TableCell>ΕΠΩΝΥΜΟ</TableCell>
      <TableCell>ΑΣΜΑ</TableCell>
      <TableCell>ΣΩΜΑ</TableCell>
      <TableCell>ΒΑΘΜΟΣ</TableCell>
      <TableCell>ΕΙΔΙΚΟΤΗΤΑ</TableCell>
      <TableCell>ΠΑΡΟΥΣΙΑΣΤΙΚΟ</TableCell>
      <TableCell>ΚΙΝΗΤΟ ΤΗΛΕΦΩΝΟ</TableCell>
      <TableCell>ΥΠΗΡΕΣΙΑΚΟ ΤΗΛΕΦΩΝΟ</TableCell>
      <TableCell>ΘΕΣΗ ΕΥΘΥΝΗΣ</TableCell>
      <TableCell>ΕΙΔΙΚΗ ΚΑΤΗΓΟΡΙΑ</TableCell>
      <TableCell>ΑΟΡΙΣΤΟΥ</TableCell>
      <TableCell>ΠΛΗΡΩΜΗ ΜΤΑ</TableCell>
    </TableRow>
  )
}

export default StaffTableColNames;
